%pyspark
import pyspark.sql
def generate_hist_plots(col):
    c1 = X[X['prediction'] == 0]
    trace1 = go.Histogram(x = c1[col]) 

    c2 = X[X['prediction'] == 1]
    trace2 = go.Histogram(x = c2[col]) 

    c3 = X[X['prediction'] == 2]
    trace3 = go.Histogram(x = c3[col]) 

    c4 = X[X['prediction'] == 3]
    trace4 = go.Histogram(x = c4[col]) 

    fig = tools.make_subplots(rows=2, cols=2, print_grid=False, subplot_titles=('Group A ' + col,'Group B ' + col,'Group C ' + col,'Group D ' + col))
    fig.append_trace(trace1, 1, 1);
    fig.append_trace(trace2, 1, 2);
    fig.append_trace(trace3, 2, 1);
    fig.append_trace(trace4, 2, 2);
    fig['layout'].update(height=600, width=0, showlegend=False);
    plot(fig, filename='simple-subplot');

col = 'White Beneficiaries'
generate_hist_plots(col)
